from ragent.connectors.llm.stt.openai import OpenAISpeechToText
from ragent.connectors.llm.stt.providers import STTProviders
from ragent.core.stt import BaseSpeechToText

'''
How to use:
llm = STTFactory.get_stt_provider(STTProviders.OPENAI)
print(llm.process_speech(base64_audio=""""""))
'''


class STTFactory:
    @staticmethod
    def get_stt_provider(provider: STTProviders) -> BaseSpeechToText:
        if provider == STTProviders.OPENAI:
            return OpenAISpeechToText()
        else:
            raise ValueError(
                f"Unsupported provider: {provider}. Available: {STTProviders.values()}"
            )
